import { 
  composeBundles,
  createUrlBundle,
  createCacheBundle
} from 'redux-bundler';

import {
  createAuthBundle,
  createOlMapBundle,
  createOlBasemapBundle,
  createJwtApiBundle
} from '@corpsmap/corpsmap-bundles';

import cache from '../utils/cache'

import routesBundle from './routes-bundle';

import drawBundle from './draw-bundle';
import createCitysdkKeyBundle from './citysdk-key-bundle';
import createCitysdkfipsBundle from './citysdk-fips-bundle';
import createSelectByFipsBundle from './select-by-fips-bundle';

export default composeBundles(
  routesBundle,
  createUrlBundle(),
  createCacheBundle(cache.set),
  createOlMapBundle(),
  createOlBasemapBundle(),
  createSelectByFipsBundle(),
  createCitysdkKeyBundle("a6db60fcc5d6bb18e9e3645ecfdd5dbee62a7c63"),
  createJwtApiBundle({
    root: 'https://x1s6pwmufa.execute-api.us-east-1.amazonaws.com/production'
  }),
  drawBundle
);
